import React, { Component } from "react";
import logoti from '../img/logo-colored.png';

class  logo extends Component {
    state = {};
    render() {
        return (
            <div className="" >
                <img src={imglogo} className="icon" alt="Logo"/>

            </div>

        ) 
    }
}

export default logo;
